import React from 'react';
export default function Pricing() {
  return <div className="max-w-2xl mx-auto py-20 text-center">
    <h1 className="text-3xl font-bold mb-4">Pricing</h1>
    <p className="text-gray-600 mb-4">Simple, transparent pricing for everyone.</p>
    <ul className="text-left mx-auto max-w-md text-gray-700 dark:text-gray-300">
      <li className="mb-2">• Free Plan: Post 1 job, basic support</li>
      <li className="mb-2">• Pro Plan: $49/mo, unlimited jobs, featured listing</li>
      <li className="mb-2">• Enterprise: Custom pricing, advanced analytics</li>
    </ul>
  </div>;
}
